import React, { useState } from "react";
import { motion, AnimatePresence } from "framer-motion";
import {
  BarChart3,
  LineChart,
  ScatterChart,
  PieChart,
  Map,
  Table,
} from "lucide-react";

// Simple replacements for Card and Button
const Card = ({ children, onClick }) => (
  <div
    onClick={onClick}
    className="bg-gradient-to-b from-blue-800 to-blue-900 text-white shadow-lg cursor-pointer rounded-2xl"
  >
    {children}
  </div>
);

const CardContent = ({ children }) => (
  <div className="p-6 flex flex-col items-center text-center space-y-4">
    {children}
  </div>
);

const Button = ({ children, onClick, className }) => (
  <button
    onClick={onClick}
    className={`px-4 py-2 rounded-lg font-semibold transition ${className}`}
  >
    {children}
  </button>
);


const visualizations = [
  {
    title: "Bar Chart",
    description:
      "Crop Production Comparison | Analyze crop yield across different states for the year 2023.",
    icon: BarChart3,
    embedUrl:
      "https://app.powerbi.com/view?r=eyJrIjoiYzA5ZjY5NTQtZjA1YS00ODRmLTlmMzItMjQ5ZjY1NDEwMjM3IiwidCI6IjY3ZjdiODIzLTk5ZWEtNGFmZS1hYjRhLWY3NjM5MzE1MjU3NSIsImMiOjEwfQ%3D%3D",
  },
  {
    title: "Line Chart",
    description:
      "Seasonal Trends in Crop Price | Displays how crop prices change across different seasons over time.",
    icon: LineChart,
    embedUrl:
      "https://app.powerbi.com/view?r=eyJrIjoiMDNmZjE4MWQtMGE4YS00ZTgwLThjMmQtMTI3ZWRjNTEwZjM0IiwidCI6IjY3ZjdiODIzLTk5ZWEtNGFmZS1hYjRhLWY3NjM5MzE1MjU3NSIsImMiOjEwfQ%3D%3D",
  },
  {
    title: "Scatter Plot",
    description:
      "Rainfall vs Crop Yield | Explore the correlation between rainfall levels and crop production in key regions.",
    icon: ScatterChart,
    embedUrl:
      "https://app.powerbi.com/view?r=eyJrIjoiN2Q5NmM5ODctY2NhMy00MTZhLWI5YmEtYjNiMmM4ZmZjNGFjIiwidCI6IjY3ZjdiODIzLTk5ZWEtNGFmZS1hYjRhLWY3NjM5MzE1MjU3NSIsImMiOjEwfQ%3D%3D",
  },
  {
    title: "Pie Chart",
    description:
      "Crop Contribution Share | Percentage share of major crops in overall agricultural production for 2023.",
    icon: PieChart,
    embedUrl:
      "https://app.powerbi.com/view?r=eyJrIjoiNWM4NDZlZjQtM2RjYS00MDkxLWIyZWItNTQyMWQyMDAwNmJmIiwidCI6IjY3ZjdiODIzLTk5ZWEtNGFmZS1hYjRhLWY3NjM5MzE1MjU3NSIsImMiOjEwfQ%3D%3D",
  },
  {
    title: "Map Visualization",
    description:
      "Crop Yield Distribution | Geographical distribution of crop yields across different states of India.",
    icon: Map,
    embedUrl:
      "https://app.powerbi.com/view?r=eyJrIjoiYjMxY2EyNWItZTI1Yy00YzhlLWIzMjEtZTViZjE2YzgyOWM1IiwidCI6IjY3ZjdiODIzLTk5ZWEtNGFmZS1hYjRhLWY3NjM5MzE1MjU3NSIsImMiOjEwfQ%3D%3D",
  },
  {
    title: "Table",
    description:
      "Crop Data Table | Detailed tabular view of crop-wise production, prices, and rainfall statistics for 2023.",
    icon: Table,
    embedUrl:
      "https://app.powerbi.com/view?r=eyJrIjoiMzdiMDU1NTItNzJlMy00Mjc3LTgzYzItZjY3N2I1ZGIwNDRhIiwidCI6IjY3ZjdiODIzLTk5ZWEtNGFmZS1hYjRhLWY3NjM5MzE1MjU3NSIsImMiOjEwfQ%3D%3D",
  },
];

export default function Dashboard() {
  const [selectedVisualization, setSelectedVisualization] = useState(null);

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-950 to-blue-900 text-white">
      <AnimatePresence mode="wait">
        {selectedVisualization ? (
          // === Visualization View (No padding) ===
          <motion.div
            key="visualization"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="w-full h-screen flex flex-col"
          >
            {/* Header */}
            <div className="flex justify-between items-center bg-gradient-to-r from-blue-800 to-blue-700 p-4">
              <div>
                <h2 className="text-2xl font-bold flex items-center gap-2">
                  <selectedVisualization.icon className="w-6 h-6" />
                  {selectedVisualization.title}
                </h2>
                <p className="text-sm opacity-80">
                  {selectedVisualization.description}
                </p>
              </div>
              <Button
                onClick={() => setSelectedVisualization(null)}
                className="bg-blue-500 hover:bg-blue-600"
              >
                Back to Grid
              </Button>
            </div>

            {/* Fullscreen Visualization */}
            <div className="w-full flex-1 p-0 m-0">
              <iframe
                src={selectedVisualization.embedUrl}
                className="w-full h-full border-0"
                allowFullScreen
                title={selectedVisualization.title}
                scrolling="no"
              />
            </div>
          </motion.div>
        ) : (
          // === Grid View (with padding) ===
          <motion.div
            key="grid"
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }}
            className="p-8"
          >
            <h1 className="text-4xl font-extrabold mb-8 text-center">
              Crop Data Visualizations
            </h1>
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
              {visualizations.map((viz, index) => (
                <motion.div
                  key={index}
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.98 }}
                >
                  <Card
                    className="bg-gradient-to-b from-blue-800 to-blue-900 text-white shadow-lg cursor-pointer rounded-2xl"
                    onClick={() => setSelectedVisualization(viz)}
                  >
                    <CardContent className="p-6 flex flex-col items-center text-center space-y-4">
                      <viz.icon className="w-12 h-12 text-blue-400" />
                      <h2 className="text-xl font-semibold">{viz.title}</h2>
                      <p className="text-sm opacity-80">{viz.description}</p>
                    </CardContent>
                  </Card>
                </motion.div>
              ))}
            </div>
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
}
